import { createSelector } from "reselect";
//input selector
const selectCart=state=> state.cart;

export const selectCartItems = createSelector(
    [selectCart],
    (cart) => cart.cartItems
);

export const selectartItemsCount = createSelector(
    [selectCartItems],
    cartItems=>
      cartItems.reduce()
)
